import React, { useState } from "react";

const PROJECTS = [
    {
        id: 1,
        title: "IoTBay - IoT Devices Ordering",
        tech: ["Java", "JSP", "MVC", "MySQL"],
        img: "https://images.unsplash.com/photo-1540350394557-8d14678e7f91?w=700&h=380&fit=crop",
        summary: "E-commerce webapp for IoT devices. Full shipment management CRUD, secure backend, Agile team.",
        details: "IoTBay lets customers browse, order, and track IoT devices like sensors/actuators. Implemented key shipment module, login system, and optimized data retrieval.",
        github: "https://github.com/jaeyunjks/IOTBay.git"
    },
    {
        id: 2,
        title: "Interaction Design Project",
        tech: ["Figma", "UX Research", "Web"],
        img: "https://images.unsplash.com/photo-1460925895917-afdab827c52f?w=700&h=380&fit=crop",
        summary: "Task manager UX case: research–persona–prototyping–usability testing–final report.",
        details: "A full HCI process case study: defined user pain points, created personas/storyboard, iterated UI via prototype and usability testing, finalized with DIA video.",
        files: [
            { label: "Journal Entry", file: "/journal-entry.pdf" },
            { label: "Persona", file: "/persona.pdf" },
            { label: "Storyboard", file: "/storyboard.png" },
            { label: "Paper Prototype", file: "/paperproto.pdf" },
            { label: "DIA Video", file: "/dia-fid.mp4" }
        ]
    },
    {
        id: 3,
        title: "DSA Directed Graph Visualizer",
        tech: ["C++", "Algorithms", "WebAssembly", "Graph Theory"],
        img: "https://images.unsplash.com/photo-1506744038136-46273834b3fb?w=700&h=380&fit=crop",
        summary: "Interactive visualization of DFS and BFS on directed graphs using WebAssembly and C++ backend.",
        details: "This tool demonstrates depth-first and breadth-first search traversals directly in the browser. It combines C++ algorithm logic, compiled to WebAssembly, with a simple web interface for visualizing graph algorithms. Designed as a portfolio piece for both DSA and programming integrations.",
        github: "https://github.com/jaeyunjks/Directed_Graph"
    }
];

export default function PortfolioPage() {
    const [expanded, setExpanded] = useState(null);

    return (
        <div style={{ maxWidth: 900, margin: "48px auto", padding: "0 17px" }}>
            <h1 style={{ fontWeight: 900, fontSize: 36, color: "#7B9ACC", marginBottom: 28 }}>
                My Portfolio
            </h1>
            <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: 32 }}>
                {PROJECTS.map(p => (
                    <div key={p.id}
                        style={{
                            background: "#EDF2FB",
                            borderRadius: 18,
                            boxShadow: "0 2px 16px #c0c7ef17",
                            padding: 21,
                            cursor: "pointer",
                            border: expanded === p.id ? "2.2px solid #7B9ACC" : "1.2px solid #e3e8f2"
                        }}
                        onClick={() => setExpanded(expanded === p.id ? null : p.id)}
                    >
                        <img src={p.img} alt={p.title}
                            style={{
                                width: "100%",
                                borderRadius: 11,
                                maxHeight: 155,
                                marginBottom: 11
                            }} />
                        <div style={{
                            fontWeight: 700,
                            fontSize: 22,
                            margin: "10px 0",
                            color: "#232751"
                        }}>{p.title}</div>
                        <div style={{
                            color: "#7B9ACC",
                            fontWeight: 600,
                            fontSize: 15,
                            letterSpacing: 1,
                            marginBottom: 7
                        }}>
                            {p.tech && p.tech.join(" · ")}
                        </div>
                        <div style={{
                            fontSize: 15,
                            opacity: .78,
                            marginBottom: 8
                        }}>{p.summary}</div>
                        <div style={{
                            fontSize: 14,
                            color: "#798",
                            marginBottom: 10
                        }}>
                            <i>Click for detail</i>
                        </div>
                        {expanded === p.id && (
                            <div style={{
                                marginTop: 8,
                                background: "#FAFCFF",
                                color: "#232751",
                                fontSize: 15,
                                lineHeight: 1.6,
                                padding: "14px 12px",
                                borderRadius: 9,
                                boxShadow: "0 2px 9px #ddeaf8"
                            }}>
                                <div style={{ marginBottom: 10 }}>{p.details}</div>
                                {p.github &&
                                    <a href={p.github} target="_blank" rel="noreferrer"
                                        style={{
                                            background: "#7B9ACC",
                                            color: "#fff",
                                            borderRadius: 9,
                                            textDecoration: "none",
                                            fontWeight: 700,
                                            padding: "7px 18px",
                                            marginRight: 14
                                        }}>
                                        View Code
                                    </a>
                                }
                                {p.files && (
                                    <>
                                        <div style={{
                                            fontWeight: 700,
                                            marginTop: 16,
                                            marginBottom: 9,
                                            fontSize: 17
                                        }}>Files:</div>
                                        <ul style={{ paddingLeft: 17, margin: 0 }}>
                                            {p.files.map(f =>
                                                <li key={f.label} style={{ marginBottom: 11 }}>
                                                    <span style={{ fontWeight: 600 }}>{f.label}:</span>
                                                    {f.file.endsWith(".png") ?
                                                        <img src={f.file} alt={f.label}
                                                            style={{
                                                                display: "block",
                                                                width: "94%",
                                                                maxWidth: 220,
                                                                borderRadius: 7,
                                                                margin: "8px 0 2px"
                                                            }} />
                                                        : f.file.endsWith(".pdf") ?
                                                            <a href={f.file} target="_blank" rel="noreferrer"
                                                                style={{
                                                                    background: "#7B9ACC",
                                                                    color: "#fff",
                                                                    borderRadius: 6,
                                                                    padding: "4px 12px",
                                                                    textDecoration: "none",
                                                                    fontWeight: 600,
                                                                    marginLeft: 10
                                                                }}>
                                                                View PDF
                                                            </a>
                                                            : f.file.endsWith(".mp4") ?
                                                                <video src={f.file} controls style={{
                                                                    width: "93%",
                                                                    maxWidth: 220,
                                                                    borderRadius: 8,
                                                                    marginLeft: 6,
                                                                    marginTop: 7
                                                                }} />
                                                                : null}
                                                </li>
                                            )}
                                        </ul>
                                    </>
                                )}
                            </div>
                        )}
                    </div>
                ))}
            </div>
        </div>
    );
}
